SELECT RTRIM(LTRIM(PR.RAZON_SOCIAL)), RTRIM(LTRIM(PR.NOMBRE_AP)), PR.NIT, B.CodigoBanco, PR.N_CUENTA, 1, ORDEN_CHEQUE, De.CodigoPais, De.CodigoDepartamento, NULL, NULL, PR.DIRECCION, PR.TELEFONOS, PR.FAX, '', PR.EMAIL, '', 1, 1
FROM CEATEC.dbo.PROVEEDORES PR
JOIN Bancos B ON
B.NombreBanco = PR.BANCO
JOIN Departamentos De ON
De.NombreDepartamento = PR.DEP_PROV

	VALUES ('ANONIMO', 'ANONIMO', 'P', '0000000000', NULL, NULL, NULL, NULL, 'ANONIMA', 'ANONIMO', 'ANONIMO', 'Cliente ANONIMO', 'H', 1)
SELECT DISTINCT LTRIM(RTRIM(NOMBRE)) + ' ' + LTRIM(RTRIM(AP_PATERNO)) + ' ' + LTRIM(RTRIM(AP_MATERNO)) AS NombreCliente, 
LTRIM(RTRIM(NOMBRE)) + ' ' + LTRIM(RTRIM(AP_PATERNO)) + ' ' + LTRIM(RTRIM(AP_MATERNO)) AS NombreRepresentante, NIT, DIRECCION, TELEFONO, 'H', 1
FROM CEATEC.dbo.CLIENTE
WHERE (NOMBRE + AP_PATERNO + AP_MATERNO IS NOT NULL) AND 
(NIT <> '' AND NIT <> '0') AND (DIRECCION = '')
ORDER BY 1

SELECT DISTINCT NOM_LINIA
FROM CEATEC.dbo.LINIA

SELECT PR.ID, LTRIM(RTRIM(PR.ID)) + LTRIM(RTRIM(PR.CBARRAS)) + SUBSTRING(PR.NOMBRE, 0, 2) + CAST(PM.CodigoMarcaProducto AS CHAR(3)), RTRIM(PR.NOMBRE), RTRIM(PR.NOMBRE), RTRIM(PR.NOMBRE), PM.CodigoMarcaProducto, 1, 1, 'B', 1, 1, 1
FROM CEATEC.dbo.PRODUCTO PR
JOIN CEATEC.dbo.LINIA LI ON
LI.ID = PR.ID_LINIA
JOIN Doblones20.dbo.ProductosMarcas PM ON
PM.NombreMarcaProducto = LI.NOM_LINIA
ORDER BY Pr.CBARRAS

SELECT DISTINCT 1, FECHA_MOD, 2, CAMBIO, TC_PARALELO
FROM CEATEC.dbo.T_CAMBIO
WHERE FECHA_MOD IS NOT NULL

